import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { Container, Box, TextField, Button, Typography, Link, Alert } from '@mui/material';

function Register() {
  const navigate = useNavigate();
  
  // Verificar tokens ao carregar o componente
  useEffect(() => {
    console.log('Register component mounted');
    console.log('userToken:', localStorage.getItem('userToken'));
    console.log('adminToken:', localStorage.getItem('adminToken'));
    
    // Verificar se há redirecionamento automático
    const isAuthenticated = localStorage.getItem('userToken') !== null || 
                           localStorage.getItem('adminToken') !== null;
    
    if (isAuthenticated) {
      console.log('User is authenticated, but should not redirect');
      // Limpar tokens para evitar redirecionamento
      localStorage.removeItem('userToken');
      localStorage.removeItem('adminToken');
    }
  }, []);

  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    confirmPassword: ''
  });
  
  const [error, setError] = useState('');
  const [success, setSuccess] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (formData.password !== formData.confirmPassword) {
      setError('As senhas não coincidem!');
      return;
    }
    
    // Simulação de registro bem-sucedido
    console.log('Registro bem-sucedido:', formData);
    setSuccess(true);
    setError('');
  };

  const handleLoginClick = () => {
    navigate('/');
  };

  return (
    <Container maxWidth="sm">
      <Box sx={{ 
        marginTop: 8,
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
      }}>
        <Typography variant="h4" component="h1" gutterBottom>
          Cadastrar-se
        </Typography>
        
        {error && <Alert severity="error" sx={{ width: '100%', mb: 2 }}>{error}</Alert>}
        {success && <Alert severity="success" sx={{ width: '100%', mb: 2 }}>Cadastro realizado com sucesso!</Alert>}
        
        {!success ? (
          <Box component="form" onSubmit={handleSubmit} sx={{ mt: 1, width: '100%' }}>
            <TextField
              name="fullName"
              margin="normal"
              required
              fullWidth
              label="Nome Completo"
              autoFocus
              value={formData.fullName}
              onChange={handleChange}
            />
            <TextField
              name="email"
              margin="normal"
              required
              fullWidth
              label="Email"
              type="email"
              autoComplete="email"
              value={formData.email}
              onChange={handleChange}
            />
            <TextField
              name="password"
              margin="normal"
              required
              fullWidth
              label="Senha"
              type="password"
              value={formData.password}
              onChange={handleChange}
            />
            <TextField
              name="confirmPassword"
              margin="normal"
              required
              fullWidth
              label="Confirmar Senha"
              type="password"
              value={formData.confirmPassword}
              onChange={handleChange}
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              Cadastrar
            </Button>
            <Box sx={{ textAlign: 'center' }}>
              <Button
                variant="text"
                onClick={handleLoginClick}
                sx={{ fontSize: '0.875rem' }}
              >
                Já tem uma conta? Faça login
              </Button>
            </Box>
          </Box>
        ) : (
          <Box sx={{ mt: 3, width: '100%', textAlign: 'center' }}>
            <Button
              variant="contained"
              onClick={handleLoginClick}
              sx={{ mt: 1 }}
            >
              Ir para Login
            </Button>
          </Box>
        )}
      </Box>
    </Container>
  );
}

export default Register;
